	@GetMapping("/getHeros")
	public List<Heros> getHeros() {
//		RestTemplate restTemplate = new RestTemplate();
//		HttpHeaders headers = new HttpHeaders();
//        //headers.setAccept(Arrays.asList(MediaType.APPLICATION_JSON));
//        headers.add("user-agent", "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/54.0.2840.99 Safari/537.36");
//        HttpEntity<String> entity = new HttpEntity<String>(headers);
//		
//		ResponseEntity<String> response = restTemplate.exchange("https://api.opendota.com/api/players/93102567",HttpMethod.GET,entity,String.class);
//		System.out.println(response.getBody());
//		JSONObject response = new JSONObject(heroData());
		JSONArray herosResponse = new JSONArray(heroData());
		
		List<Heros> heroList = new ArrayList<>();
		
		for(int i = 0; i < herosResponse.length(); i++) {
			JSONObject heroInfo = herosResponse.getJSONObject(i);
			
			Heros hero = new Heros();
			hero.setId((int)heroInfo.get("id"));
			hero.setName(heroInfo.getString("localized_name"));
			String[] heroImgSplit = heroInfo.get("img").toString().split("/");
			String heroImg = heroImgSplit[heroImgSplit.length-1].replace("?","");
			hero.setHeroImage(heroImg);
			
			heroList.add(hero);
		}
		
		herosRepository.saveAll(heroList);
		
		return heroList;
		
	}
	@GetMapping("/recentMatches")
	public List<PlayerMatch> getRecentMatches() {
		List<Heros> heroList = herosRepository.findAll();
		
		RestTemplate restTemplate = new RestTemplate();
		HttpHeaders headers = new HttpHeaders();
		//headers.setAccept(Arrays.asList(MediaType.APPLICATION_JSON));
		headers.add("user-agent", "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/54.0.2840.99 Safari/537.36");
		HttpEntity<String> entity = new HttpEntity<String>(headers);
		
		ResponseEntity<String> response = restTemplate.exchange("https://api.opendota.com/api/players/93102567/recentMatches",HttpMethod.GET,entity,String.class);
		JSONArray recentMatchesList = new JSONArray(response.getBody());
		
		List<PlayerMatch> playerMatchList = new ArrayList<>();
		
		for(int i = 0; i < recentMatchesList.length(); i++) {
			PlayerMatch playerMatch = new PlayerMatch();
			for(Heros hero : heroList) {
				if(hero.getId() == recentMatchesList.getJSONObject(i).getInt("hero_id")) {
					playerMatch.setHeroName(hero.getName());					
					break;
				}
			}
			playerMatch.setKills(recentMatchesList.getJSONObject(i).getInt("kills"));
			playerMatch.setDeaths(recentMatchesList.getJSONObject(i).getInt("deaths"));
			playerMatch.setAssists(recentMatchesList.getJSONObject(i).getInt("assists"));
			playerMatch.setMatchId(recentMatchesList.getJSONObject(i).getLong("match_id"));
			playerMatchList.add(playerMatch);
		}
		
		
		return playerMatchList;
		
		
	}
	
