	public void saveImage(String storePath, String imagePath) {

		RestTemplate restTemplate = new RestTemplate();
		HttpEntity<String> entity = openDotaAPIUtils.dotaOpenAPIHeader();
		

		FileOutputStream fos = null;
		try {
			String[] imagePathSplit = imagePath.split("/");
			String imageName = imagePathSplit[imagePathSplit.length-1];
			imageName = imageName.replaceAll("\\?t*=*[0-9]*", "");
			
				
			ResponseEntity<byte[]> response = restTemplate.exchange("https://api.opendota.com" + imagePath,HttpMethod.GET,entity,byte[].class);
//			response = restTemplate.exchange("https://api.opendota.com" + imagePath,HttpMethod.GET,entity,Object.class);
			//System.out.println(response.getBody());
			
			fos = new FileOutputStream(storePath + imageName);
			fos.write(response.getBody());				
			
//			if(response.getStatusCode() != HttpStatus.OK) {
//				fos.write(response.getBody());				
//			}
			
			fos.close();
			
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}catch(HttpClientErrorException ex) {
			System.out.println("failed to get image: " + imagePath);
		}
				
	}
	
	

	
